import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Layout from './pages/Layout';

import Home from './pages/Home.js';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/CoreModular/' element={<Layout />}>
          <Route index element={<Home />} />
        </Route>
      </Routes>
    </BrowserRouter>
  )
}

export default App;
